    {
    MeasurementType = "Difference",
    Value = recallDifference
    }
    };

  var precisionDifference = Math.Abs((_iterationPerformance[currentIteration.Id].Precision * 100) - 100);
  donutChart["Precision"] = new DataItem[] {
    new DataItem {
